        "question": "Muchos consideran que el estr\u00e9s es una sobrecarga de trabajo y de problemas. En la oficina, en casa, en nuestra vida social y sentimental, estamos sometidos a emociones, presiones y tensiones. Estas tensiones crean inestabilidad, lo cual trae consecuencias sobre nuestra salud f\u00edsica y mental. Para muchas personas es normal padecer de estr\u00e9s. A veces, incluso, es motivo de orgullo, un signo de \u00e9xito profesional en una sociedad que nos empuja a ser cada vez m\u00e1s competitivos. En general, el estr\u00e9s es un estado de tensi\u00f3n en que se halla una persona, debido a la amenaza de las condiciones ambientales. Esto ocasiona desequilibrio, baja estima y sentimientos de culpa. Sin embargo, el estr\u00e9s no puede considerarse como una enfermedad. Es una respuesta f\u00edsica y mental del ser humano a los diversos acontecimientos vitales.Hay dos tipos de estr\u00e9s: psicol\u00f3gico y f\u00edsico. En el estr\u00e9s psicol\u00f3gico, las tensiones mentales se manifiestan a trav\u00e9s de una perturbaci\u00f3n de los pensamientos. La persona hace todo deprisa, no piensa antes de actuar, tiene pensamientos obsesivos y se desconcentra. El cuerpo afectado llega a un estado de desequilibrio que impide regular correctamente sus funciones. La digesti\u00f3n, el sue\u00f1o, la respiraci\u00f3n y la regulaci\u00f3n card\u00edaca se ven afectados. La persona manifiesta depresi\u00f3n, hipersensibilidad, ansiedad, miedo. El estr\u00e9s f\u00edsico se manifiesta en tensi\u00f3n de los m\u00fasculos. Esta tensi\u00f3n aumenta el nivel del cuello y de los hombros, principalmente el m\u00fasculo trapecio (m\u00fasculo del estr\u00e9s) y el esternocleidomastoideo. Los m\u00fasculos maxilares, oculares, de las sienes, de la frente y de los labios se ven afectados.El estr\u00e9s afecta a un 80% de la poblaci\u00f3n mundial. Si conoci\u00e9ramos los desastrosos efectos del estr\u00e9s sobre el organismo y la mente, no nos sentir\u00edamos orgullosos ni encontrar\u00edamos normal estar estresado.<strong>En el texto se establece una relaci\u00f3n de causa-efecto entre</strong>", 
