        "tip_msg": "COMPRENSI\u00d3N DE LECTURALa comprensi\u00f3n de lectura es el proceso por el cual un lector interpreta y aprehende el contenido esencial de un texto. Adem\u00e1s, en este proces\u00f3 , interact\u00faan los conocimientos previos del lector y la informaci\u00f3n que plantea el texto. De ah\u00ed que, la lectura se eval\u00faa en tres niveles: literal (recordar datos expl\u00edcitos), inferencial (identificar las ideas impl\u00edcitas) y cr\u00edtico (valoraci\u00f3n del texto). En los ex\u00e1menes de admisi\u00f3n se eval\u00faan los dos primeros, a trav\u00e9s de las siguientes preguntas:A) Preguntas por sentido contextual o par\u00e1frasis: Eval\u00faan la capacidad para expresar un t\u00e9rmino o locuci\u00f3n del texto con otro u otros t\u00e9rminos equivalentes.B) Preguntas por jerarqu\u00eda textual: Eval\u00faan la capacidad para jerarquizar la informaci\u00f3n, es decir. identificar el tema central, la idea principal, la s\u00edntesis del texto.C) Preguntas por afirmaci\u00f3n compatible / incompatible: Eval\u00faan la comprensi\u00f3n sobre cuestiones particulares vinculadas con la idea principal, las ideas secundarias y sus derivaciones.D) Preguntas por inferencia: Eval\u00faan la comprensi\u00f3n de las ideas impl\u00edcitas del texto. Por lo tanto, la respuesta es una conclusi\u00f3n que se obtiene de premisas o datos expl\u00edcitos.E) Preguntas por extrapolaci\u00f3n: Miden la capacidad para deducir las posibles consecuencias o situaciones si, hipot\u00e9ticamente, variaran las premisas, condiciones, circunstancias, etc., del texto.", 
