        "question": "<strong>El problema fundamental que hay detr\u00e1s del concepto de \"lenguaje privado\" es que carece de reglas. Uno pudiera insistir en que s\u00ed las tiene, solo que son \"privadas\" y, as\u00ed, patrimonio exclusivo del propio hablante. Pero estar\u00edamos en un terrible error si tom\u00e1ramos tal cosa por cierta. Una regla siempre tiene criterios de correcci\u00f3n, es decir, deber\u00edamos saber siempre cu\u00e1ndo cometemos una equivocaci\u00f3n y empleamos mal la regla: pero, cuando esto falla, es porque no estamos usando, en realidad, regla alguna. Para plantearlo en t\u00e9rminos claros, la gram\u00e1tica de \"seguir una regla\" exige tener criterios de correcci\u00f3n. Y esto quiere decir, en pocas palabras, que no puede existir un lenguaje con criterios privados o. dicho de otro modo, los criterios de correcci\u00f3n, las reglas, son p\u00fablicos por definici\u00f3n. Todo lenguaje es necesariamente p\u00fablico.</strong><strong> Ahora, supongamos que alguien insistiera en que puede uno tener un lenguaje para s\u00ed mismo. Entonces podremos someterlo a un test muy sencillo: \u00bfpuede usted traducir ese lenguaje suyo al nuestro? Si puede, entonces no es un lenguaje privado genuino, y de seguro que se basa en reglas y criterios p\u00fablicos como el nuestro, aunque tal vez \u00e9l los oculte. Y si no puede. y es incomunicable, entonces no es ning\u00fan lenguaje.</strong><strong>PREGUNTA: Fundamentalmente, el autor sostiene</strong>", 
