        "question": "<strong>Para comprender bien el origen y significado de las leyendas de los hombres lobo, comencemos por caracterizar a este animal, temido y admirado, a trav\u00e9s de los datos que nos ofrece el libro Animal, editado por The Smithsonian Institution en 1996. Miembro de la familia Canidae, es pariente cercano de los perros, los coyotes, los chacales y los zorros, reconocidos por su gran resistencia y su comportamiento oportunista y adaptable. Sus cuerpos son musculosos y est\u00e1n cubiertos de un pelaje de color uniforme. Tienen cuatro dedos en las patas traseras y cinco en las delanteras. Cuentan con zarpas cortas que no se retraen, de punta roma. Su verdadero poder estriba en sus quijadas largas y dientes caninos (que solemos llamar \u201ccolmillos\u201d) que les sirven para herir profundamente a sus presas, as\u00ed como en los molares carniceros en la parte posterior de la quijada, muelas muy desarrolladas, cortantes y punzantes. Todos los c\u00e1nidos detectan a sus presas gracias a su poderoso olfato y cuentan con un o\u00eddo muy desarrollado. Su vista es potente; sin embargo, no resulta un sentido tan relevante. Las especies peque\u00f1as de los c\u00e1nidos, como los chacales y los zorros, viven solos o en parejas; las especies mayores, como los lobos, lo hacen en manadas.</strong><strong>El famoso protagonista de cuentos y leyendas es el lobo gris o Canis lupus, el miembro salvaje m\u00e1s grande de la familia de los c\u00e1nidos. Habitante de Norteam\u00e9rica, Groenlandia, Europa y Asia, mide entre 1 y 1,5 metros, sin contar la cola, que puede alcanzar hasta 51 cent\u00edmetros; y su peso oscila entre los 16 y los 60 kilos. En alguna \u00e9poca fue el animal carn\u00edvoro m\u00e1s extendido en el mundo; no obstante, con el desarrollo de la ganader\u00eda se le consider\u00f3 una plaga por sus recurrentes ataques y se inici\u00f3 su exterminio masivo. Un caso ejemplar es el del lobo mexicano (Canis lupus baileyi), una de las especies m\u00e1s peque\u00f1as. En la d\u00e9cada de 1950, Estados Unidos y M\u00e9xico iniciaron una campa\u00f1a masiva para extinguirlo y hoy quedan apenas 200 ejemplares.</strong><strong>Los lobos han demostrado que la organizaci\u00f3n social no es exclusiva de los seres humanos. Para sobrevivir se agrupan en manadas de 8 a 12 individuos con una jerarqu\u00eda bastante definida a cuya cabeza se encuentra una pareja dominante de hembra y macho. Las manadas patrullan territorios, los marcan con su aroma y cazan en grupo, lo que les permite apoderarse de presas mucho mayores que ellos, como el alce o el carib\u00fa. Una de las expresiones m\u00e1s asombrosas de esta especie es el profundo aullido que emiten mientras alzan la cabeza para anunciar su presencia, definir y defender sus territorios. Este es audible a distancia de seis kil\u00f3metros y mantiene alejadas a las manadas rivales.</strong><strong><em>PREGUNTA: \u00a0\u00bfCu\u00e1l es el tema central del texto?</em></strong>", 
