        "question": "<strong>El dep\u00f3sito de vapor de agua es 140 mil millones de veces m\u00e1s grande que la suma de todos los oc\u00e9anos y est\u00e1 a 12 mil millones de a\u00f1os luz de nuestro planeta. Astr\u00f3nomos del Instituto de Tecnolog\u00eda de California y de la Universidad de Colorado descubrieron la reserva de agua m\u00e1s grande y lejana del universo a una distancia de 48 mil millones de billones de kil\u00f3metros, inform\u00f3 el portal infobae.com.</strong><strong>El agua est\u00e1 en estado gaseoso y es 140 mil millones de veces m\u00e1s grande que la suma de todos los oc\u00e9anos de nuestro planeta y 100 mil veces m\u00e1s grande que el sol. Adem\u00e1s, est\u00e1 rodeando un qu\u00e1sar a m\u00e1s de 12 mil millones de a\u00f1os luz de distancia, se\u00f1al\u00f3 el diario Daily Mail.</strong><strong>\u201cLos qu\u00e1sares son n\u00facleos gal\u00e1cticos brillantes y violentos que son alimentados por un agujero negro s\u00faper masivo en su centro\u201d, explic\u00f3 el art\u00edculo. El qu\u00e1sar estudiado se llama APM 08279 +5255, alberga un agujero negro 20 mil millones de veces m\u00e1s masivo que el Sol y produce tanta energ\u00eda como mil billones de soles juntos.</strong><strong>Este hallazgo \u201ces una demostraci\u00f3n m\u00e1s de que el agua es un fen\u00f3meno generalizado en todo el Universo, incluso en los tiempos m\u00e1s primitivos\u201d, se\u00f1al\u00f3 Matt Bradford, cient\u00edfico de la NASA. Aunque ya se hab\u00eda localizado agua en el Universo, esta es la primera vez que se detecta tan distante y en forma tan masiva. La investigaci\u00f3n fue publicada en la revista Astrophysical Journal Letters</strong>.<em><strong>PREGUNTA: En el texto, el t\u00e9rmino ALBERGA puede reemplazarse por</strong></em>&nbsp;&nbsp;", 
