        "answer_data": "a:5:{i:0;O:27:\"WpProQuiz_Model_AnswerTypes\":7:{s:10:\"*_answer\";s:114:\"A) La manera id\u00f3nea de comprender la opaca realidad emp\u00edrica es a trav\u00e9s de modelos matem\u00e1ticos transparentes.\";s:8:\"*_html\";b:0;s:10:\"*_points\";i:1;s:11:\"*_correct\";b:1;s:14:\"*_sortString\";s:0:\"\";s:18:\"*_sortStringHtml\";b:0;s:10:\"*_mapper\";N;}i:1;O:27:\"WpProQuiz_Model_AnswerTypes\":7:{s:10:\"*_answer\";s:123:\"B) La construcci\u00f3n de modelos matem\u00e1ticos como explicaci\u00f3n de la realidad emp\u00edrica es un ideal que viene del siglo XVII\";s:8:\"*_html\";b:0;s:10:\"*_points\";i:1;s:11:\"*_correct\";b:0;s:14:\"*_sortString\";s:0:\"\";s:18:\"*_sortStringHtml\";b:0;s:10:\"*_mapper\";N;}i:2;O:27:\"WpProQuiz_Model_AnswerTypes\":7:{s:10:\"*_answer\";s:111:\"C) Para resolver los problemas del mundo matem\u00e1tico disponemos de varias t\u00e9cnicas conceptuales potent\u00edsimas.\";s:8:\"*_html\";b:0;s:10:\"*_points\";i:1;s:11:\"*_correct\";b:0;s:14:\"*_sortString\";s:0:\"\";s:18:\"*_sortStringHtml\";b:0;s:10:\"*_mapper\";N;}i:3;O:27:\"WpProQuiz_Model_AnswerTypes\":7:{s:10:\"*_answer\";s:119:\"D) El lenguaje de las matem\u00e1ticas es preciso porque corresponde a un mundo ficticio, concebido y creado por el hombre.\";s:8:\"*_html\";b:0;s:10:\"*_points\";i:1;s:11:\"*_correct\";b:0;s:14:\"*_sortString\";s:0:\"\";s:18:\"*_sortStringHtml\";b:0;s:10:\"*_mapper\";N;}i:4;O:27:\"WpProQuiz_Model_AnswerTypes\":7:{s:10:\"*_answer\";s:113:\"E) Es sorprendente que el mundo ficticio de las matem\u00e1ticas nos proporcione representaciones emp\u00edricas fiables.\";s:8:\"*_html\";b:0;s:10:\"*_points\";i:1;s:11:\"*_correct\";b:0;s:14:\"*_sortString\";s:0:\"\";s:18:\"*_sortStringHtml\";b:0;s:10:\"*_mapper\";N;}}", 
