        "question": "<strong>La realidad que nos rodea es enormemente compleja y en gran parte resulta opaca a nuestra comprensi\u00f3n y manipulaci\u00f3n intelectual. Sin embargo, el mundo ficticio de la matem\u00e1tica, que nosotros hemos creado, es mucho m\u00e1s transparente y mejor conocido. Adem\u00e1s, disponemos de t\u00e9cnicas conceptuales potent\u00edsimas para resolver los problemas acerca del mundo matem\u00e1tico formulados en el lenguaje de las matem\u00e1ticas.</strong><strong>Afortunadamente, y desde el siglo XVII, hemos salido del marasmo en que nos hab\u00eda sumido el intento por comprender directamente la realidad, y hemos aprendido a conquistarla por la ruta indirecta de la modelizaci\u00f3n cuantitativa.</strong><strong>Construimos modelos matem\u00e1ticos de la realidad emp\u00edrica, y trasladamos a esos modelos los problemas que la realidad nos plantea. Esos problemas, as\u00ed traducidos al lenguaje matem\u00e1tico, son susceptibles de ser analizados y resueltos matem\u00e1ticamente. Y la soluci\u00f3n matem\u00e1tica, retraducida al lenguaje emp\u00edrico, se convierte en una soluci\u00f3n satisfactoria de nuestros iniciales problemas reales.</strong><strong>Resulta sorprendente que ese rodeo por el mundo ficticio de la matem\u00e1tica nos proporcione representaciones fiables del mundo real de los procesos f\u00edsicos y soluciones eficaces a nuestros problemas emp\u00edricos de todo tipo, incluso econ\u00f3micas y pol\u00edticos.</strong><em><strong>PREGUNTA: \u00bfCu\u00e1l de los siguientes enunciados ofrece un mejor resumen del texto?</strong></em>&nbsp;", 
